import React, {Component} from 'react';
export default class News extends Component {
    render(){
        return (
            <div className='border-bottom border-top padding-sm relative'>
                <div className="marquee">
                    <ul className="marquee-content">
                        <li className="marquee-item"><span className>[Nov.2021]</span>Invited Talk at GyeongGi Cultural Foundation in Korea</li>
                        <li className="marquee-item">[Dec.2021] Invited Talk and Workshop at San Jose State University</li>
                        <li className="marquee-item">[Jan.2022] Juror for PacificVis 2022</li>
                        <li className="marquee-item">[Nov.2021] Invited Talk at GyeongGi Cultural Foundation in Korea</li>
                        <li className="marquee-item">[Dec.2021] Invited Talk and Workshop at San Jose State University</li>
                        <li className="marquee-item">[Jan.2022] Juror for PacificVis 2022</li>
                    </ul>
                </div>
            </div>
        )
    }
}
